import img from "../../../assets/img/backgroundSignin.jpg"
import classes from "./AddRoomPage.module.css"
import { Link, useParams, useHistory } from "react-router-dom";
import { useContext, useState } from "react"
import AuthContext from '../../../store/auth-context';
import {createRoom} from '../../../api/RoomApi'

const typeData = [
    {
        text: "Family House",
        value: "0"
    },
    {
        text: "House & Villa",
        value: "1"
    },
    {
        text: "Apartment",
        value: "2"
    },
    {
        text: "Office & Studio",
        value: "3"
    },
    {
        text: "Villa & Condo",
        value: "4"
    },
    
]

const AddRoomPage = () => {
    const params = useParams()

    const id = params.id
    
    const history = useHistory()
    
    const authCtx = useContext(AuthContext)
    
    const [values, setValues] = useState({
        house_id: id,
        name: '',
        room_type: '0',
        area: 0,
        max_tenant: 1,
        rentPrice: 0,
        waterPrice: 0,
        electricityPrice: 0,
        servicePrice: 0,
        detail: '',
    })
    
    const{house_id, room_name, room_type, area, max_tenant, 
        rentPrice, waterPrice, electricityPrice, servicePrice, detail} = values
        
    const handleChange = (key) => {
        return (event) => {
            setValues({...values, [key]: event.target.value})
        }
    }
    
    const submitHandler = (event) => {
        event.preventDefault();
        
        const room = {
            house_id: house_id,
            name: name,
            room_type: room_type,
            area: area,
            max_tenant: max_tenant,
            rentPrice: rentPrice,
            waterPrice: waterPrice,
            electricityPrice: electricityPrice,
            servicePrice: servicePrice,
            detail: detail,
        }
        
        // optional: Add validation
        
        // createRoomApi(room, authCtx.userId, authCtx.token)
        // .then(() => {
        //     history.replace("/manage")
        // })
        // .catch((err) => {
        //     alert(err.message);
        // });
    }
    
    return (
        <section className={classes.back}>
            <div className={classes.center}>
                <h1>Add Room</h1>
                <form method="POST" onSubmit={submitHandler}>
                    <div className={classes.txt_field}>
                        <select 
                            value={room_type}
                            onChange={handleChange('room_type')}
                        >
                            {typeData.map(type => <option value={type.value}>{type.text}</option>)}
                        </select>
                        <span></span>
                        <label>Type</label>
                    </div>
                    <div className={classes.txt_field}>
                        <input type="text" required value={name}
                            onChange={handleChange('name')}/>
                        <span></span>
                        <label>Name</label>
                    </div>
                    <div className={classes.txt_field}>
                        <input type="number" required value={area}
                            onChange={handleChange('area')}/>
                        <span></span>
                        <label>Area</label>
                    </div>
                    <div className={classes.txt_field}>
                        <input type="number" required value={rentPrice}
                            onChange={handleChange('rentPrice')}/>
                        <span></span>
                        <label>Rent Price</label>
                    </div>
                    <div className={classes.txt_field}>
                        <input type="number" required value={waterPrice}
                            onChange={handleChange('waterPrice')}/>
                        <span></span>
                        <label>Water Price</label>
                    </div>
                    <div className={classes.txt_field}>
                        <input type="number" required value={electricityPrice}
                            onChange={handleChange('electricityPrice')}/>
                        <span></span>
                        <label>Electricity Price</label>
                    </div>
                    <div className={classes.txt_field}>
                        <input type="number" required value={servicePrice}
                            onChange={handleChange('servicePrice')}/>
                        <span></span>
                        <label>Service Price</label>
                    </div>
                    <div className={classes.txt_field}>
                        <input type="text" required value={detail}
                            onChange={handleChange('detail')}/>
                        <span></span>
                        <label>Detail</label>
                    </div>
                    <button type="submit">Add</button>
                    <div className={classes.signup_link}>
                        <Link to="/">home</Link>
                    </div>
                </form>
            </div>
            <img src={img} alt='' />
        </section>
    )
}

export default AddRoomPage
